import styled from "styled-components";

function App() {

  const Father = styled.div`
    display: flex;
  `;

  const Btn = styled.button`
    color:white;
    background-color: tomato;
    border: 0;
    border-radius: 15px;
  `;

  return (
    <Father>
      <Btn>Log in</Btn>
      <Btn as="a">Log in</Btn>
    </Father>
  );
}

export default App;
